void OAIFlexV1FlexFlowApi::updateFlexFlow(const QString &sid, const ::OpenAPI::OptionalParam<OAIFlex_flow_enum_channel_type> &channel_type, const ::OpenAPI::OptionalParam<QString> &chat_service_sid, const ::OpenAPI::OptionalParam<QString> &contact_identity, const ::OpenAPI::OptionalParam<bool> &enabled, const ::OpenAPI::OptionalParam<QString> &friendly_name, const ::OpenAPI::OptionalParam<QString> &integration_channel, const ::OpenAPI::OptionalParam<bool> &integration_creation_on_message, const ::OpenAPI::OptionalParam<QString> &integration_flow_sid, const ::OpenAPI::OptionalParam<qint32> &integration_priority, const ::OpenAPI::OptionalParam<qint32> &integration_retry_count, const ::OpenAPI::OptionalParam<qint32> &integration_timeout, const ::OpenAPI::OptionalParam<QString> &integration_url, const ::OpenAPI::OptionalParam<QString> &integration_workflow_sid, const ::OpenAPI::OptionalParam<QString> &integration_workspace_sid, const ::OpenAPI::OptionalParam<OAIFlex_flow_enum_integration_type> &integration_type, const ::OpenAPI::OptionalParam<bool> &janitor_enabled, const ::OpenAPI::OptionalParam<bool> &long_lived) {
    QString fullPath = QString(_serverConfigs["updateFlexFlow"][_serverIndices.value("updateFlexFlow")].URL()+"/v1/FlexFlows/{Sid}");
    
    if (!_username.isEmpty() && !_password.isEmpty()) {
        QByteArray b64;
        b64.append(_username.toUtf8() + ":" + _password.toUtf8());
        addHeaders("Authorization","Basic " + b64.toBase64());
    }
    
    {
        QString sidPathParam("{");
        sidPathParam.append("Sid").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "Sid", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"Sid"+pathSuffix : pathPrefix;
        fullPath.replace(sidPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(sid)));
    }
    OAIHttpRequestWorker *worker = new OAIHttpRequestWorker(this, _manager);
    worker->setTimeOut(_timeOut);
    worker->setWorkingDirectory(_workingDirectory);
    OAIHttpRequestInput input(fullPath, "POST");

    if (channel_type.hasValue())
    {
        input.add_var("ChannelType", ::OpenAPI::toStringValue(channel_type.value()));
    }
    if (chat_service_sid.hasValue())
    {
        input.add_var("ChatServiceSid", ::OpenAPI::toStringValue(chat_service_sid.value()));
    }
    if (contact_identity.hasValue())
    {
        input.add_var("ContactIdentity", ::OpenAPI::toStringValue(contact_identity.value()));
    }
    if (enabled.hasValue())
    {
        input.add_var("Enabled", ::OpenAPI::toStringValue(enabled.value()));
    }
    if (friendly_name.hasValue())
    {
        input.add_var("FriendlyName", ::OpenAPI::toStringValue(friendly_name.value()));
    }
    if (integration_channel.hasValue())
    {
        input.add_var("Integration.Channel", ::OpenAPI::toStringValue(integration_channel.value()));
    }
    if (integration_creation_on_message.hasValue())
    {
        input.add_var("Integration.CreationOnMessage", ::OpenAPI::toStringValue(integration_creation_on_message.value()));
    }
    if (integration_flow_sid.hasValue())
    {
        input.add_var("Integration.FlowSid", ::OpenAPI::toStringValue(integration_flow_sid.value()));
    }
    if (integration_priority.hasValue())
    {
        input.add_var("Integration.Priority", ::OpenAPI::toStringValue(integration_priority.value()));
    }
    if (integration_retry_count.hasValue())
    {
        input.add_var("Integration.RetryCount", ::OpenAPI::toStringValue(integration_retry_count.value()));
    }
    if (integration_timeout.hasValue())
    {
        input.add_var("Integration.Timeout", ::OpenAPI::toStringValue(integration_timeout.value()));
    }
    if (integration_url.hasValue())
    {
        input.add_var("Integration.Url", ::OpenAPI::toStringValue(integration_url.value()));
    }
    if (integration_workflow_sid.hasValue())
    {
        input.add_var("Integration.WorkflowSid", ::OpenAPI::toStringValue(integration_workflow_sid.value()));
    }
    if (integration_workspace_sid.hasValue())
    {
        input.add_var("Integration.WorkspaceSid", ::OpenAPI::toStringValue(integration_workspace_sid.value()));
    }
    if (integration_type.hasValue())
    {
        input.add_var("IntegrationType", ::OpenAPI::toStringValue(integration_type.value()));
    }
    if (janitor_enabled.hasValue())
    {
        input.add_var("JanitorEnabled", ::OpenAPI::toStringValue(janitor_enabled.value()));
    }
    if (long_lived.hasValue())
    {
        input.add_var("LongLived", ::OpenAPI::toStringValue(long_lived.value()));
    }

    for (auto keyValueIt = _defaultHeaders.keyValueBegin(); keyValueIt != _defaultHeaders.keyValueEnd(); keyValueIt++) {
        input.headers.insert(keyValueIt->first, keyValueIt->second);
    }


    connect(worker, &OAIHttpRequestWorker::on_execution_finished, this, &OAIFlexV1FlexFlowApi::updateFlexFlowCallback);
    connect(this, &OAIFlexV1FlexFlowApi::abortRequestsSignal, worker, &QObject::deleteLater);
    connect(worker, &QObject::destroyed, this, [this]() {
        if (findChildren<OAIHttpRequestWorker*>().count() == 0) {
            Q_EMIT allPendingRequestsCompleted();
        }
    });

    worker->execute(&input);
}

void OAIFlexV1FlexFlowApi::updateFlexFlowCallback(OAIHttpRequestWorker *worker) {
    QString error_str = worker->error_str;
    QNetworkReply::NetworkError error_type = worker->error_type;

    if (worker->error_type != QNetworkReply::NoError) {
        error_str = QString("%1, %2").arg(worker->error_str, QString(worker->response));
    }
    OAIFlex_v1_flex_flow output(QString(worker->response));
    worker->deleteLater();

    if (worker->error_type == QNetworkReply::NoError) {
        Q_EMIT updateFlexFlowSignal(output);
        Q_EMIT updateFlexFlowSignalFull(worker, output);
    } else {

#if defined(_MSC_VER)
// For MSVC
#pragma warning(push)
#pragma warning(disable : 4996)
#elif defined(__clang__)
// For Clang
#pragma clang diagnostic push
#pragma clang diagnostic ignored "-Wdeprecated-declarations"
#elif defined(__GNUC__)
// For GCC
#pragma GCC diagnostic push
#pragma GCC diagnostic ignored "-Wdeprecated-declarations"
#endif

        Q_EMIT updateFlexFlowSignalE(output, error_type, error_str);
        Q_EMIT updateFlexFlowSignalEFull(worker, error_type, error_str);

#if defined(_MSC_VER)
#pragma warning(pop)
#elif defined(__clang__)
#pragma clang diagnostic pop
#elif defined(__GNUC__)
#pragma GCC diagnostic pop
#endif

        Q_EMIT updateFlexFlowSignalError(output, error_type, error_str);
        Q_EMIT updateFlexFlowSignalErrorFull(worker, error_type, error_str);
    }
}

void OAIFlexV1FlexFlowApi::tokenAvailable(){

    oauthToken token;
    switch (_OauthMethod) {
    case 1: //implicit flow
        token = _implicitFlow.getToken(_latestScope.join(" "));
        if(token.isValid()){
            _latestInput.headers.insert("Authorization", "Bearer " + token.getToken());
            _latestWorker->execute(&_latestInput);
        }else{
            _implicitFlow.removeToken(_latestScope.join(" "));
            qDebug() << "Could not retrieve a valid token";
        }
        break;
    case 2: //authorization flow
        token = _authFlow.getToken(_latestScope.join(" "));
        if(token.isValid()){
            _latestInput.headers.insert("Authorization", "Bearer " + token.getToken());
            _latestWorker->execute(&_latestInput);
        }else{
            _authFlow.removeToken(_latestScope.join(" "));
            qDebug() << "Could not retrieve a valid token";
        }
        break;
    case 3: //client credentials flow
        token = _credentialFlow.getToken(_latestScope.join(" "));
        if(token.isValid()){
            _latestInput.headers.insert("Authorization", "Bearer " + token.getToken());
            _latestWorker->execute(&_latestInput);
        }else{
            _credentialFlow.removeToken(_latestScope.join(" "));
            qDebug() << "Could not retrieve a valid token";
        }
        break;
    case 4: //resource owner password flow
        token = _passwordFlow.getToken(_latestScope.join(" "));
        if(token.isValid()){
            _latestInput.headers.insert("Authorization", "Bearer " + token.getToken());
            _latestWorker->execute(&_latestInput);
        }else{
            _credentialFlow.removeToken(_latestScope.join(" "));
            qDebug() << "Could not retrieve a valid token";
        }
        break;
    default:
        qDebug() << "No Oauth method set!";
        break;
    }
}
